import axios from 'axios';
import React, { useEffect, useState } from 'react'

const User = () => {
  const [showData, setShowData] = useState("");
  const [err, setErr] = useState("");

  useEffect(() => {
    axios.get('http://localhost:4000/regRoute/register').then(e => setShowData(e.data)).catch(err => setErr(err.message))
  }, [])

  if (err) {
    <h4>console.error();</h4>
  }

return (
  <>
    <div>{showData.map(e =>{return <h2>Hi, {e.name}</h2>})}</div>
  </>
)
}

export default User
